import Button from "@mui/joy/Button";
import { useNavigate, redirect, Form } from "react-router-dom";

export default function Appartamenti() {
  const navigate = useNavigate();
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        width:"100"
      }}
    >
      <Container
        maxWidth="sm"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          height: "40vh",
          width: "20vw",
          backgroundColor: "rgb(5, 22, 34)",
          borderRadius: "5vh",
        }}
      >

      </Container>
    </Container>
  );
}
